import Url from "./Url"

const SocketConnection = () => {

    const [url, setUr] = useState('')

    return (
        <div className="card col-12">
            <div className="card-body row">
                <div className="col-12">
                <Url url={url}/>
                </div>

                <div className="col-12">
                {/* // Request Headers Component */}
                </div>

                <div className="col-6">
                    {/* // Messages from Server Component */}
                </div>

                <div className="col-6">
                    {/* // Messages to Server Component */}
                </div>
            </div>
        </div>
    )
}
export default SocketConnection
